import React from "react";
import PostItem from "./posts";

export default function PostList({posts, title}) {
    return(
        <div>
            <h1>{title}</h1>
            {posts.map(
                (post)=>{
                    <PostItem post={post}/>
                }
            )
            }
        </div>
    )
}
